Here are my top family friendly things to do in Destin FL:

@thedestincommons - a shopping center with everything you need for a rainy day, or a break from the beach. They have bowling, restaurants for days, a splash pad & an amazing climbing structure for littles (with a Starbucks right there!)

@gulfarium is just a short drive away on  Okaloosa Island. This is a unique visit right on the beach where you can watch marine shows, see how they care and rehabilitate animals all while feeling like you are strolling the beach. 

@sandestin the Sandestin property is home to a wide variety of accommodations including our favorite @hiltonsandestin they also have a wonderful boardwalk called @baytownewharf open to resort guests and sometimes the public.

The Destin Boardwalk is home to many vendors where you can shop, dine and explore destin. Don’t forget to rent a ride to @crab_island 

Our favorite hidden gem isn’t even on the beach, it’s on the inlet. Captain leonard Destin Park by @cityofdestinofficial is a beach with a beautiful splash pad, playground and views of wildlife. 

Grab lunch or dinner @lulusdestin the best food & a view. Plus plenty of entertainment and room to wonder for littles. We have seen dolphins from our table while dining multiple times. 

I could go on and on, but I suggest you explore yourself! What is one thing on this list you would love to do?

