If you were to ask me 10 years ago if I would put @experiencegrandrapids on my top 10 vacation destination spots I probably would have laughed. But today it ranks in my top 5. 

As a mom travel with kids is tough, so I look for family friendly cities and locations that have something for everyone and Grand Rapids hits the mark every time. Here are a few of my favorite things in @experiencegrandrapids 

@amwaygrandplaza the best luxury hotel at affordable prices in the area. It’s walking distance to so many great downtown places & just an Uber away from more!

@johnballzoogr I went here as a baby, volunteered here as a teen, worked here as an adult & bring my kids as often as I can as a mom. 

@grcmuseum - this hands on museum is perfect for kids & adults! Rotating exhibits keep everything interesting in my boys love going every single time we’re in town! 

@dtmarketgr this is one of my personal favs & the holiday market is no exception the CHRISTKINDL MARKT 2023 is still@going on and you don’t want to miss the festive booths & treats! 

I could go on and on about @experiencegrandrapids but I’ll leave you with this. It’s not just a city to eat, sleep & work. It’s a town that holds onto the love of the arts, is family friendly & gives Beer City USA a run for its money!
